    public boolean isIsomorphic(String s, String t) {
        boolean isoMorph = true;
        LinkedHashMap<String, Integer[]> sVals = new LinkedHashMap<>();
        LinkedHashMap<String, Integer[]> rVals = new LinkedHashMap<>();

        for(int i=0; i<s.length(); i++){
            String schar = String.valueOf(s.charAt(i));
            if(sVals.get(schar) == null){
                sVals.put(schar, new Integer[s.length()]);
            }
            String tchar = String.valueOf(t.charAt(i));
            if(rVals.get(tchar) == null){
                rVals.put(tchar, new Integer[t.length()]);
            }
            sVals.get(schar)[i] = 1;
            rVals.get(tchar)[i] = 1;
        }
        java.util.Collection<Integer[]> sc = sVals.values();
        java.util.Collection<Integer[]> tc = rVals.values();
        Object[] ss =  sc.toArray();
        Object[] ts =  tc.toArray();
        for(int i=0; i<ss.length; i++){
            Integer[] x = (Integer[])ss[i];
            Integer[] y = (Integer[])ts[i];
            for(int j=0; j<x.length; j++){
                if(x[j] != y[j]){
                    return false;
                }
            }
        }
        return isoMorph;
    }
